const CourseList = ({courses}) =>{
    return (
        <div className="course-list">
            {courses.map((course)=>(
                <div className="course-preview">
                    <h2>{course.course}</h2>
                    <p>Grade: {course.grade}</p>
                    <p>Codigo: {course.code}</p>
                </div>
            ))}
        </div>
    );   
}

export default CourseList;
